import { Component } from '@angular/core';
import { HttpClient, HttpHeaders } from '@angular/common/http';

@Component({
  selector: 'app-calculate',
  templateUrl: './calculate.component.html',
  styleUrls: ['./calculate.component.css']
})
export class CalculateComponent {
  userLocation: { latitude: number; longitude: number } = { latitude: 0, longitude: 0 };
  chosenSpot: string = '';
  cyclingSpeed: number = 0;
  dailyCyclingHours: number = 0;
  estimatedTime: number | null = null;
  spotDetails: any[] = []; // Array to store spot details

  constructor(private http: HttpClient) {
    // Fetch all spot details from the server
    const token = localStorage.getItem('token');
    if (!token) {
      console.error('No token found. Please log in.');
      return;
    }

    const headers = new HttpHeaders().set('Authorization', `Bearer ${token}`);
    const options = { headers };

    // Adjust the URL to match your server's endpoint for fetching all spots.
    this.http.get('http://localhost:4000/spots/all', options).subscribe(
      (response: any) => {
        this.spotDetails = response;
      },
      (error) => {
        console.error('Failed to fetch spot details:', error);
      }
    );
  }

  calculateTime(): void {
    // Find the chosen spot's latitude and longitude based on the selected spot's name
    const selectedSpot = this.spotDetails.find((spot) => spot.name === this.chosenSpot);

    if (selectedSpot) {
      this.userLocation.latitude = selectedSpot.latitude;
      this.userLocation.longitude = selectedSpot.longitude;
    } else {
      console.error('Spot not found in spot details');
      return;
    }

    const token = localStorage.getItem('token');
    if (!token) {
      console.error('No token found. Please log in.');
      return;
    }

    const headers = new HttpHeaders().set('Authorization', `Bearer ${token}`);
    const options = { headers };

    // Adjust the URL to match your server's endpoint for calculating the time.
    const url = 'http://localhost:4000/calculate';
    const requestBody = {
      userLocation: this.userLocation,
      chosenSpot: this.chosenSpot,
      cyclingSpeed: this.cyclingSpeed,
      dailyCyclingHours: this.dailyCyclingHours
    };

    this.http.post<number>(url, requestBody, options).subscribe(
      (response: number) => {
        this.estimatedTime = response;
      },
      (error) => {
        console.error('Calculation failed:', error);
        this.estimatedTime = null;
      }
    );
  }
}
<div class="calculate">
  <h2>Calculate Cycling Time</h2>
  <div>
    <label for="latitude">Your Latitude:</label>
    <input type="number" id="latitude" [(ngModel)]="userLocation.latitude" />
  </div>
  <div>
    <label for="longitude">Your Longitude:</label>
    <input type="number" id="longitude" [(ngModel)]="userLocation.longitude" />
  </div>
  <div>
    <label for="spot">Choose a Spot:</label>
    <select id="spot" [(ngModel)]="chosenSpot">
      <option *ngFor="let spot of spots" [ngValue]="spot">{{ spot.name }}</option>
    </select>
  </div>
  <div>
    <label for="cyclingSpeed">Cycling Speed (km/h):</label>
    <input type="number" id="cyclingSpeed" [(ngModel)]="cyclingSpeed" />
  </div>
  <div>
    <label for="dailyCyclingHours">Daily Cycling Hours:</label>
    <input type="number" id="dailyCyclingHours" [(ngModel)]="dailyCyclingHours" />
  </div>
  <button (click)="calculateTime()">Calculate</button>
  <div *ngIf="estimatedTime !== null">
    <p>Estimated Time: {{ estimatedTime }} hours</p>
  </div>
</div>
